script: |
  super -f text -I q6432.spq | sort > q6432.out

inputs:
  - name: q6432.spq
    data: |
      SELECT DISTINCT COUNT ( * ) AS col0 FROM tab2 (FORMAT parquet) AS cor0 CROSS JOIN tab1 (FORMAT parquet) AS cor1 WHERE NULL IS NULL;
  - name: tab1
  - name: tab2

outputs:
  - name: q6432.out
    data: |
      9
